class Solution(object):
    def numIslands(self, grid):
        """
        :type grid: List[List[str]]
        :rtype: int
        """
        R = len(grid)
        if not R:
            return 0
        C = len(grid[0])
        
        V = [[0]*C for _ in xrange(R)]
        
        from collections import deque
        def bfs(r, c):
            q = deque()
            V[r][c] = 1
            q.append( (r, c) )

            while q:
                r, c = q.popleft()
                for nr, nc in ( (r-1, c), (r+1, c), (r, c-1), (r, c+1) ):
                    if nr < 0 or nc < 0 or nr >= R or nc >= C: continue 
                    if V[nr][nc] or grid[nr][nc] == '0': continue
                    V[nr][nc] = 1
                    q.append( (nr, nc) )
                
        islandCount = 0
        for r in xrange(R):
            for c in xrange(C):
                if grid[r][c] == '1' and not V[r][c]:
                    islandCount += 1
                    bfs(r, c)
                    
        return islandCount

